import React from 'react'
import Img from "./CardData"
import Cards from "./Card"


function Regards() {
    return (
        <div>
            <h5>We thank the following organizations for their major commitments to support the Jenkins project.</h5>
            {Img.map((val)=>{
                return (
                    <Cards 
                        link = {val.link} />
                )
            })}
        </div>
    )
}

export default Regards
